import React from "react";
import { useState } from "react";

const Home = ()=>{

    const [Data ,setData]=useState([])
    const submit = async ()=>{
        await fetch("/api/Dummy/")
        .then(response=>response.json())
        .then(d => setData(d));
        console.log(Data);
    };

    return (
        <div>Home
        <button onClick={submit}>Click</button>
        <table>

        </table>
        </div>
    )
};

export default Home;
